    fun getYearInfo(lunaYear: Int, index: Int) = yInfo[lunaYear - minLunaYear].getItem(index)

    data class LunaDateModel(
        var lm: Int = 0,
        var lunaMonth: Int = 0,
        var lunaDay: Int = 0,
        var daysPerMonth: Int = 0,
    ) {
        fun getItem(index: Int): Int {
            return when (index) {
                0 -> lm
                1 -> lunaMonth
                2 -> lunaDay
                else -> daysPerMonth
            }
        }
    }
